import React from "react";

import styles from "./smallCard.module.css";

const SmallCard = () => {
  const smallCardStyles = {};
  return (
    <div style={smallCardStyles}>
      <h2 className={styles.movieName}>Terminator:dark fate</h2>
    </div>
  );
};

export default SmallCard;
